Blockly.Msg.TOUR1_DESCRIPTION01 = "Bienvenido,<br>haz clic en »siguiente« y comienza un recorrido por Open Roberta Lab.<br>Te mostraré cómo puedes programar tu robot con NEPO.<br>Puedes finalizar este recorrido en cualquier momento haciendo clic en »X« en la esquina superior derecha.";
Blockly.Msg.TOUR1_DESCRIPTION02 = "El menu ;-)";
Blockly.Msg.TOUR1_DESCRIPTION03 = "¡Aquí puedes encontrar todo lo que necesitas para programar el robot!<br><span class:'typcn typcn-document-text'></span> Guardar y cargar programas<br><span class:'typcn typcn-ev3'></span> Conectar tu robot a Open Roberta Lab o cambiar a otro sistema<br><span class:'typcn typcn-lightbulb'></span> Ayuda para todo tipo de problemas<br><span class:'typcn typcn-user'></span>Todo sobre las cuentas de usuario, por ejemplo, inicio de sesión o cierre de sesión<br><span class:'typcn typcn-th-large-outline'></span> Echa un vistazo a la galería y prueba programas geniales de otros usuarios<br><span class:'typcn typcn-world'></span> Haz clic aquí para cambiar a otro idioma";
Blockly.Msg.TOUR1_DESCRIPTION04 = "Haz clic aquí y cambia a la configuración del robot.";
Blockly.Msg.TOUR1_DESCRIPTION05 = "Puedes adaptar la configuración del robot más adelante,<br>si has construido otro robot.<br>Si no tienes un robot y quieres probar tu programa en la simulación,<br>esta configuración se aplicará.";
