Blockly.Msg.TOUR1_DESCRIPTION08 = "Cada programa comieza con un boque inicio«.<br>Los demás bloques que el robot debe ejecutar se conectan con este bloque .<br>Simplemente arrastra el bloque deseado hasta justo debajo del bloque inicio,";
Blockly.Msg.TOUR1_DESCRIPTION09 = "Aquí encontrarás algunos atajos!<br>From left to right:<br><span class='typcn typcn-media-play'></span> Click here to execute the program on the real robot<br><span class='typcn typcn-media-play-outline'></span> Click here to start the robot in the simulation<br><span class='typcn typcn-cloud-storage'></span> Save your program, but before that you need to sign in<br><span class='typcn typcn-zoom'></span> Click here and zoom in on the blocks, if you want to<br><span class='typcn typcn-archive'></span> The trashcan! Just move blocks into the trashcan and they will be deleted.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Attention: You cannot recover blocks once they are deleted!<br>";
